import react from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import Spline from "./Animation";

function App() {
    return (
        <div>
            <Spline />
            <Header />
            <Note />
            <Footer />
        </div>
    );
}

export default App ;
